"use strict";
const input = [];
const strToNumberArr = (str) => {
  str.split(" ").map(Number);
};
require("readline")
  .createInterface(process.stdin, process.stdout)
  .on("line", function (line) {
    input.push(line.trim());
  })
  .on("close", function () {
    console.log(input);
    let [B, E] = strToNumberArr(input[0]);
    console.log(B);
  });
